import './App.css';
import { Container, Row, Card, Col } from 'react-bootstrap';
import NavigationBar from './Components/NavigationBar';
import Bienvenue from './Components/Bienvenue';

function App() {
    const marginTop = {
        marginTop: "20px",
    };

    return (
        <div className="App">
            <NavigationBar />
            <Container>
                <Bienvenue/>
            </Container>
        </div>
    );
}

export default App;
